INSERT products (id, receipt_date, name, title, description, price, amount, category_id, company_id)
VALUES (1, '2023-01-15 10:15:30.55', 'Монитор Samsung C27F390FHI 27" Black', '1920x1080/VA/60Hz/4ms/VGA (D-Sub), HDMI, VESA', 'Samsung C27F390FHI - 27-дюймовый монитор с изогнутым экраном. Благодаря такому конструктивному решению обеспечивается более глубокое погружение в процесс, что особенно актуально для игр и кино. Разрешение картинки составляет 1920 x 1080 пикселей. Антибликовое же покрытие позволяет с комфортом пользоваться устройством даже в условиях чрезмерной освещенности. Однако все это лишь вершина Айсберга, а на деле достоинств у данной модели намного больше. Взять, например, технологию Flicker Free, способствующую снижению мерцаний. Таким образом, в значительной степени уменьшается нагрузка на глаза, вследствие чего вы можете работать или же наслаждаться играми/кино в течение более длительного времени. Время отклика составляет - 1 мс. Этого показателя вполне достаточно для того, чтобы переходы между кадрами в процессе демонстрации динамичных сцен отображались предельно плавно. Для подключения к ПК, игровым консолям и прочим видам мультимедийной техники можно будет задействовать интерфейсы HDMI и VGA.', 14890, 10, 2, 8),
       (2, '2023-01-15 10:15:30.55', 'Монитор 24" Samsung C24F390FHI', '1920x1080/VA/60Hz/4ms/VGA (D-Sub), HDMI, VESA', 'Samsung C24F390FHI - 24-дюймовый монитор с изогнутым экраном. Благодаря такому конструктивному решению обеспечивается более глубокое погружение в процесс, что особенно актуально для игр и кино. Разрешение картинки составляет 1920 x 1080 пикселей. Антибликовое же покрытие позволяет с комфортом пользоваться устройством даже в условиях чрезмерной освещенности. Однако это - лишь вершина Айсберга, а на деле достоинств у данной модели намного больше. Взять, например, технологию Flicker Free, способствующую снижению мерцаний. Таким образом, в значительной степени уменьшается нагрузка на глаза, вследствие чего вы можете работать или же наслаждаться играми/кино в течение более длительного времени. Время отклика составляет - 4 мс. Этого показателя вполне достаточно для того, чтобы переходы между кадрами в процессе демонстрации динамичных сцен отображались предельно плавно. Для подключения к ПК, игровым консолям и прочим видам мультимедийной техники можно будет задействовать интерфейсы HDMI и VGA. Также имеется аудиовыход 3,5 мм, позволяющий вывести звук на наушники или же внешние динамики.', 12120, 10, 2, 8),
       (3, '2023-01-15 10:15:30.55', 'Монитор 32" Samsung M8 LS32BM801UIXCI', '3840x2160/VA/60Hz/713х575х204 мм/VGA (D-Sub), HDMI, VESA', 'Smart TV Центр управления умным домом Wi-Fi 5 и Bluetooth 4.2.', 53930, 10, 2, 8),
       (4, '2023-01-15 10:15:30.55', 'Монитор 32" Samsung Odyssey G5 C32G55TQBI', '2560x1440/VA/60Hz/710x534x273 мм/VGA (D-Sub), HDMI, VESA', 'Smart TV Центр управления умным домом Wi-Fi 5 и Bluetooth 4.2.', 32110, 10, 2, 8),
       (5, '2023-01-15 10:15:30.55', 'Монитор Philips 243V7QDAB/00(01) 23.8" Black', '1920x1080/IPS/5ms/VGA (D-Sub), DVI, HDMI, Speaker, VESA', 'Philips 243V7QDAB - прекрасный монитор среднего класса, который прекрасно справится с широким спектром задач, будь то просмотр кино, игры или же работа с текстовыми документами. Благодаря использованию передовых технологий, инженерам компании удалось сократить до минимума уровень синего цвета и мерцаний, быстро приводящих к усталости глаз и негативным образом сказывающихся на зрении пользователя. Диагональ экрана составляет 23.8 дюймов, а разрешение картинки - 1920 x 1080 пикселей. Благодаря использованию IPS-матрицы картинка остается предельно контрастной и четкой практически под любым углом. Важный момент для любителей мультимедийных развлечений - это время отклика. Чем ниже данный показатель, тем более плавными выглядят переходы от одного кадра к другому в динамичных сценах. В мониторе Philips 243V7QDAB значение этого показателя равняется 5 мс, чего вполне достаточного для устранения эффекта "рваной" картинки. Для подключения к ПК, игровым консолям и прочим устройствам можно использовать разъем VGA или HDMI. Обратите внимание на то, что в данном мониторе имеются встроенные динамики. Также вы можете использовать внешние или же наушники, задействовав аудиовыход.', 12800, 10, 2, 7),
