       (12, '2023-02-13 10:15:30.55', 'Монитор AOC E2270SWDN 22" Black', '1920x1080/TN/75Hz/5ms/VGA (D-Sub), DVI, VESA', 'Монитор модели AOC E2270SWDN – качественная модель, которая будет радовать своего владельца при каждом включении. Сумела собрать в себе все самое лучшее и современное что на данный момент изобретено в мире графических технологий. По истине великолепные показатели способные удивить даже требовательного пользователя. Идеально решение в среднем ценовом сегменте.Монитор модели Dell S2716DG производилось только из надежных, качественных и тактильно приятных материалов. Все стыки тщательно обработаны, все ровное и гладкое, при нажатии нечего не скрипит и не люфтит. Отвечает всем самым высоким требованиям по безопасности. За красивую картинку в мониторе отвечает матрица с разрешением на 1920 x 1080 пикселей. Диагональ самого экрана составляет – 21.5 дюйма. Картинка получается очень сочной и хорошо прорисованной, уровень глубины высокий. Модель особенно понравится тем, кто часто работает с текстом. Даже на протяжении многих часов на пролет, вы будете чувствовать усталость на минимально уровне, чем не могут похвастаться многие модели мониторов. Имеет специальное покрытие, которое не даст появляются отсветам и бликам на экране монитора даже при очень ярком освещении. Гибкая и мобильная конструкция позволит вам наклонять и поворачивать устройство так, как вам захочется. Комплект поставки стандартный, в него входит монитор указанной модели, кабель питания, кабель VGA, CD-диск, документация.', 8110, 10, 2, 1),
       (13, '2023-02-13 10:15:30.55', 'Монитор 24" AOC Value Line Q24V4EA', 'черный IPS 2560x1440 250 cd / m^2 4 ms HDMI DisplayPort', 'Качественная модель, которая будет радовать своего владельца при каждом включении', 19110, 10, 2, 1),
