       (36, '2023-03-17 10:15:30.55', 'Процессор AMD Ryzen 5 3600 OEM', 'AMD AM4 / Matisse / 6 core / 3600 Мгц / 7 нм', 'Процессоры серии Ryzen - одни из наиболее мощных в линейке от AMD. И если вы стремитесь добиться высокой производительности в играх, ресурсоемких приложениях и/или хотите обеспечить мультизадачность системы, то данная модель послужит для вас идеальным приобретением. Отличительной особенностью процессора AMD Ryzen 5 3600 является тот факт, что изготавливается он в соответствии с технологическим процессом 7 нм. Этим и объясняется высокая производительность, помноженная на низкий уровень потребления энергии и выделения тепла. Кэш третьего уровня в размере 32 Мб обеспечит дополнительную скорость при обработке часто используемых данных. Увеличить мощность можно будет как с помощью режима Turbo, так и специально разработанной утилиты, предоставляющей богатые возможности в отношении разгона. Также с ее помощью вы можете следить за состоянием температуры чипа, не допуская превышения критических значений.', 8650, 10, 5, 14),
