       (44, '2023-03-20 10:15:30.55', 'Жесткий диск Western Digital WD10EZEX 1 Tb', 'SATA III 6 Gb/s / 3.5" / 7200 rpm / 64 Mb', 'Компания Western Digital неоднократно удивляла пользователей своими разработками и сериями продукции в сфере систем хранения данных. В свое время подобным удивлением стала линейка WD Blue, ярким представителем которой является накопитель WD10EZEX. Данная модель представляет собой сбалансированное в аспектах производительности, уровней шума и энергопотребления решение. Она характеризуется более высокими показателями производительности, нежели ее предшественники, чего удалось достичь посредством реализации нескольких модификаций, в первую очередь, использования одной пластины вместо двух по 512 Гб.', 3760, 10, 3, 15),
       (45, '2023-03-20 10:15:30.55', 'Жесткий диск Seagate Barracuda 4 Tb', 'SATA III 6 Gb/s / 3.5" / 5400 rpm / 256 Mb', 'Компания Seagate Russia является надежным официальным дилером продукции Seagate (Сигейт) - известного производителя жестких дисков, твердотельных и гибридных накопителей для хранения данных, одного из мировых лидеров в этой области. Бренд, которому доверяют хранение составляющих жизни: файлов и фотографий, библиотек, историй и новейших научных данных. Наш каталог продукции включает жёсткие диски и решения для хранения данных, а именно жесткие диски HDD, SSD твердотельные накопители, внешние жесткие диски, внешние SSD.', 7750, 10, 3, 16),
       (46, '2023-03-20 10:15:30.55', 'Жесткий диск Western Digital WD20EZBX 2 Tb', 'SATA III 6 Gb/s / 3.5" / 7200 rpm / 256 Mb', 'Компания Western Digital неоднократно удивляла пользователей своими разработками и сериями продукции в сфере систем хранения данных. В свое время подобным удивлением стала линейка WD Blue, ярким представителем которой является накопитель WD10EZEX. Данная модель представляет собой сбалансированное в аспектах производительности, уровней шума и энергопотребления решение. Она характеризуется более высокими показателями производительности, нежели ее предшественники, чего удалось достичь посредством реализации нескольких модификаций, в первую очередь, использования одной пластины вместо двух по 512 Гб.', 4740, 10, 3, 15),
       (47, '2023-03-20 10:15:30.55', 'Жесткий диск Seagate ST1000DM010 1 Tb', 'SATA III 6 Gb/s / 3.5" / 7200 rpm / 64 Mb', 'Необходимость в увеличении свободного места - одна из проблем, которая рано или поздно встает перед каждым пользователем. К примеру, вы включаете ПК с мыслью о том, чтобы было бы неплохо скачать свежий фильм или же установить новую игру. И тут вы вдруг обнаруживаете, что свободного на жестком диске больше не осталось. Можно, конечно, удалить что-нибудь не шибко нужное, но надолго ли вам хватит расчищенного пространства? Поэтому рекомендуем вам незамедлительно приобрести себе новый диск, нежели каждый раз искать какие-то компромиссы при возникновении подобных потребностей.Данная модель может похвастаться высокой скоростью вращения шпинделя и большим размером кэша. Поэтому передача данных будет проходить на относительно высокой скорости.', 3620, 10, 3, 16);

